s.aI(0,"Dual Effect Removal",new A.ban(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/dual_effect_removal_example.dart","    In this example we show how a dual effect can be used and removed.\n    To remove an effect, tap anywhere on the screen and the first tap will\n    remove the OpacityEffect and the second tap removes the ColorEffect.\n    In this example, when an effect is removed the component is reset to\n    the state (the part of the state that was affected by the running effect)\n    that it had before the effect started running.\n  ")
s.aI(0,"Rotate Effect",new A.bao(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/rotate_effect_example.dart",'    The outer rim rotates at a different speed forward and reverse, and\n    uses the "ease" animation curve.\n\n    The compass arrow has 3 rotation effects applied to it at the same\n    time: one effect rotates the arrow at a constant speed, and two more\n    add small amounts of wobble, creating quasi-chaotic movement.\n  ')
s.aI(0,"Size Effect",new A.bap(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/size_effect_example.dart","    The `SizeEffect` changes the size of the component, the sizes of the\n    children will stay the same.\n    In this example you can tap the screen and the component will size up or\n    down, depending on its current state.\n  ")
s.aI(0,"Scale Effect",new A.baq(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/scale_effect_example.dart","    In this example you can tap the screen and the component will scale up or\n    down, depending on its current state.\n    \n    The star pulsates randomly using a RandomEffectController.\n  ")
s.aI(0,"Opacity Effect",new A.bar(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/opacity_effect_example.dart","    In this example we show how the `OpacityEffect` can be used in two ways.\n    The left Ember will constantly pulse in and out of opacity and the right\n    flame will change opacity when you click the screen.\n  ")
s.aI(0,"Color Effect",new A.bas(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/color_effect_example.dart","    In this example we show how the `ColorEffect` can be used.\n    Ember will constantly pulse in and out of a blue color.\n  ")
s.aI(0,"Sequence Effect",new A.bat(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/sequence_effect_example.dart","    Sequence of effects, consisting of a move effect, a rotate effect, another\n    move effect, a scale effect, and then one more move effect. The sequence\n    then runs in the opposite order (alternate = true) and loops infinitely\n    (infinite = true).\n  ")
s.aI(0,"Remove Effect",new A.bau(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/remove_effect_example.dart","    Click on any circle to apply a RemoveEffect, which will make the circle\n    disappear after a 0.5 second delay.\n  ")
